import service from '@/utils/request'

// @Tags LearningRecord
// @Summary 创建LearningRecord
// @Security ApiKeyAuth
// @accept application/json
// @Produce application/json
// @Param data body model.LearningRecord true "创建LearningRecord"
// @Success 200 {string} string "{"success":true,"data":{},"msg":"获取成功"}"
// @Router /learningRecord/createLearningRecord [post]
export const createLearningRecord = (data) => {
    return service({
        url: '/learningRecord/createLearningRecord',
        method: 'post',
        data
    })
}

// @Tags LearningRecord
// @Summary 删除LearningRecord
// @Security ApiKeyAuth
// @accept application/json
// @Produce application/json
// @Param data body model.LearningRecord true "删除LearningRecord"
// @Success 200 {string} string "{"success":true,"data":{},"msg":"删除成功"}"
// @Router /learningRecord/deleteLearningRecord [delete]
export const deleteLearningRecord = (data) => {
    return service({
        url: '/learningRecord/deleteLearningRecord',
        method: 'delete',
        data
    })
}

// @Tags LearningRecord
// @Summary 删除LearningRecord
// @Security ApiKeyAuth
// @accept application/json
