// @Success 200 {string} string "{"success":true,"data":{},"msg":"更新成功"}"
// @Router /learningRecord/updateLearningRecord [put]
export const updateLearningRecord = (data) => {
    return service({
        url: '/learningRecord/updateLearningRecord',
        method: 'put',
        data
    })
}

// @Tags LearningRecord
// @Summary 用id查询LearningRecord
// @Security ApiKeyAuth
// @accept application/json
// @Produce application/json
// @Param data body model.LearningRecord true "用id查询LearningRecord"
// @Success 200 {string} string "{"success":true,"data":{},"msg":"查询成功"}"
// @Router /learningRecord/findLearningRecord [get]
export const findLearningRecord = (params) => {
    return service({
        url: '/learningRecord/findLearningRecord',
        method: 'get',
        params
    })
}

// @Tags LearningRecord
// @Summary 分页获取LearningRecord列表
// @Security ApiKeyAuth
